import productsArray from './state'


const AddProd = () => {


    const buttonAddClick = () => {
        const newProduct = {
          category: 'New Category',
          price: '$99.99',
          stocked: true,
          name: "WTFFFFFFFF"
        };

        productsArray.push(newProduct);

        alert(productsArray.length)

    }

  return (
    <div>
      <input
        type="text"
        placeholder="AddProdName"
      />
      <button
      style={{
        height:'45px',
        marginLeft:'10px'
      }}

      onClick={buttonAddClick}

      >
        confirm
      </button>
    </div>
  )
}

export default AddProd
